import React from 'react';
import Navbar from './component/navbar/Navbar';
import Board from './component/box/board/Board';

function App() {
  return (
    <div style={{ display: 'flex', gap: '20px', alignItems: 'center' }}>
      <Navbar style={{ flex: '1' }} />
      <Board style={{ flex: '1' }} />
    </div>
  );
}


export default App;
